.data-labels {
  font-size: 12px;
  text-anchor: middle;
  font-family: helvetica, arial, sans-serif;
  pointer-events: none;
}
.enhancedScatterChart {
  position: absolute;
  cursor: default;
}
.enhancedScatterChart .svgScrollable {
  overflow: hidden;
}
.enhancedScatterChart path.dot {
  fill: transparent;
  stroke-width: 3px;
}
.enhancedScatterChart .notSelected {
  opacity: 0.6;
}
.enhancedScatterChart .selected {
  opacity: 1;
}
.enhancedScatterChart .axisGraphicsContext text {
  font-family: helvetica, arial, sans-serif;
  font-size: 11px;
  fill: #777777;
}
.enhancedScatterChart .axis path,
.enhancedScatterChart .axis line {
  fill: none;
  stroke: #777777;
  shape-rendering: auto;
}
.enhancedScatterChart .crosshairCanvas {
  display: none;
  pointer-events: none;
}
.enhancedScatterChart .crosshairCanvas .crosshairLine {
  stroke-width: 1px;
  stroke-dasharray: 5, 5;
}
.enhancedScatterChart .crosshairCanvas .crosshairText {
  stroke-width: 0;
  font-size: 10px;
  font-weight: bold;
}


